import React from 'react';
import classes from './MoviePoster.module.css'

const moviePoster = props => (
    <div className={classes.MoviePoster}>
        <h1>{props.title}</h1>
        <img src={props.src} alt={props.title}/>
    </div>
);

export default moviePoster;
